    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Protection Island and San Juan Islands NWRs for
    the next 15 years. This plan outlines the refuges' vision and purpose and describes
    how Protection Island and San Juan Islands NWRs will contribute to the overall mission
    of the Refuge System. The plan provides an introduction to the refuges, an overview
    of the CCP process, information about the physical and biological environment, information
    about the management direction, and a description of the human environment. Key
    planning issues include: wildlife disturbance, oil spills, marine debris, invasive
    species, climate change, deer management, habitat restoration, camping, boat access,
    community outreach, wilderness, and research.",nt"license_title": "License
